import arrowicon from '../images/carousel/arrow.png';
import card1 from '../images/carousel/card1.jpg';
import card2 from '../images/carousel/card2.jpg';
import card3 from '../images/carousel/card3.jpg';
import card4 from '../images/carousel/card4.jpg';
import card5 from '../images/carousel/card5.jpg';
import card6 from '../images/carousel/card6.jpg';
import card7 from '../images/carousel/card7.jpg';
import card8 from '../images/carousel/card8.jpg';
import card9 from '../images/carousel/card9.jpg';
import card10 from '../images/carousel/card10.jpg';


const productContainers = [...document.querySelectorAll('.product-container')];
const nxtBtn = [...document.querySelectorAll('.nxt-btn')];
const preBtn = [...document.querySelectorAll('.pre-btn')];

productContainers.forEach((item, i) => {
    let containerDimensions = item.getBoundingClientRect();
    let containerWidth = containerDimensions.width;

    nxtBtn[i].addEventListener('click', () => {
        item.scrollLeft += containerWidth;
    })

    preBtn[i].addEventListener('click', () => {
        item.scrollLeft -= containerWidth;
    })
})

function HomeNewProducts() {
    return(
        <>
            <div className="container section new-products">
                <div className="row secondarybg">
                    <div className="col-4">
                        <p><h3>New arrivals</h3></p>
                        <hr/>
                        <p>Elevate your healthcare offerings with cutting-edge medications and treatments just in! Our new products uphold the highest quality and effectiveness standards.</p>
                        <p>Stay ahead in healthcare with our carefully curated products. </p>
                    </div>
                    <div className="col-6 product">
                        <button className="pre-btn"><img src={arrowicon} alt=""/></button>
                        <button className="nxt-btn"><img src={arrowicon}  alt=""/></button>

                        <div className="product-container">
                            <div className="product-card">
                                <div className="product-image">
                                    <img src={card1}class="product-thumb" alt=""/>
                                </div>
                                <div className="product-info">
                                    <p className="product-brand">Dymista Nasal Spray</p>
                                    <p className="product-category">Illness / Ear, Nose & Throat</p>
                                </div>
                            </div>

                            <div className="product-card">
                                <div className="product-image">
                                    <img src={card2} className="product-thumb" alt=""/>
                                    <button className="card-btn">add to wishlist</button>
                                </div>
                                <div className="product-info">
                                    <h2 className="product-brand">brand</h2>
                                    <p className="footnote">a short line about the cloth..</p>
                                    <span className="price">$20</span><span className="actual-price">$40</span>
                                </div>
                            </div>

                            <div className="product-card">
                                <div className="product-image">
                                    <img src={card3} className="product-thumb" alt=""/>
                                    <button className="card-btn">add to wishlist</button>
                                </div>
                                <div className="product-info">
                                    <h2 className="product-brand">brand</h2>
                                    <p className="product-short-description">a short line about the cloth..</p>
                                    <span className="price">$20</span><span className="actual-price">$40</span>
                                </div>
                            </div>

                            <div className="product-card">
                                <div className="product-image">
                                    <img src={card4} className="product-thumb" alt=""/>
                                    <button className="card-btn">add to wishlist</button>
                                </div>
                                <div className="product-info">
                                    <h2 className="product-brand">brand</h2>
                                    <p className="product-short-description">a short line about the cloth..</p>
                                    <span className="price">$20</span><span className="actual-price">$40</span>
                                </div>
                            </div>

                            <div className="product-card">
                                <div className="product-image">
                                    <img src={card5} className="product-thumb" alt=""/>
                                    <button className="card-btn">add to wishlist</button>
                                </div>
                                <div className="product-info">
                                    <h2 className="product-brand">brand</h2>
                                    <p className="product-short-description">a short line about the cloth..</p>
                                    <span className="price">$20</span><span className="actual-price">$40</span>
                                </div>
                            </div>
                        </div>
        


                    </div>
                </div>

            </div>
        </>
    );
}

export default HomeNewProducts;
